	/**
	 * Method useItemImpl.
	 * @param player Player
	 * @param item ItemInstance
	 * @param ctrl boolean
	 * @return boolean
	 */
	@Override
	protected boolean useItemImpl(Player player, ItemInstance item, boolean ctrl)
	{
		int itemId = item.getItemId();
		if (player._identItem)
		{
			return false;
		}
		if (!canBeExtracted(itemId, player))
		{
			return false;
		}
		double[][] _rewards = rewards.get(itemId);
		if ((_rewards == null) || (_rewards.length <= 0))
		{
			return false;
		}
		player.broadcastPacket(new L2GameServerPacket[]
		{
			new MagicSkillUse(player, player, 12012, 1, 5000, 5100L)
		});
		player._identItem = true;
		ThreadPoolManager.getInstance().schedule(new StartIdent(player, _rewards, itemId), 5000);
		return true;
	}
	
	/**
	 * @author Mobius
	 */
	static class StartIdent extends RunnableImpl
	{
		/**
		 * Field _player.
		 */
		private final Player _player;
		/**
		 * Field _rewards.
		 */
		private final double[][] _rewards;
		/**
		 * Field _itemId.
		 */
		private final int _itemId;
		
		/**
		 * Constructor for StartIdent.
		 * @param player Player
		 * @param rewards double[][]
		 * @param itemId int
		 */
		StartIdent(Player player, double[][] rewards, int itemId)
		{
			_player = player;
			_rewards = rewards;
			_itemId = itemId;
		}
		
		/**
		 * Method runImpl.
		 */
		@Override
		public void runImpl()
		{
			if (Functions.removeItem(_player, _itemId, 1) != 1)
			{
				return;
			}
			_player.sendPacket(new SystemMessage(SystemMessage.S2_S1_HAS_DISAPPEARED).addItemName(_itemId));
			double rndNum = 100.0D * Rnd.nextDouble();
			double chance = 0.0D;
			double chanceFrom = 0.0D;
			for (double[] reward : _rewards)
			{
				chance = reward[2];
				if ((rndNum >= chanceFrom) && (rndNum <= (chance + chanceFrom)))
				{
					ItemFunctions.addItem(_player.getPlayer(), (int) reward[0], (int) reward[1], false);
					_player.sendPacket(new SystemMessage(SystemMessage.YOU_HAVE_OBTAINED_S1).addItemName((int) reward[0]));
					_player._identItem = false;
					break;
				}
				chanceFrom += chance;
			}
			_player._identItem = false;
		}
	}
	
	/**
	 * Method canBeExtracted.
	 * @param itemId int
	 * @param player Player
	 * @return boolean
	 */
	public static boolean canBeExtracted(int itemId, Player player)
	{
		if (player == null)
		{
			return false;
		}
		if ((player.getWeightPenalty() >= 3) || (player.getInventory().getSize() > (player.getInventoryLimit() - 10)))
		{
			player.sendPacket(Msg.YOUR_INVENTORY_IS_FULL, new SystemMessage(SystemMessage.S1_CANNOT_BE_USED_DUE_TO_UNSUITABLE_TERMS).addItemName(itemId));
			return false;
		}
		return true;
	}
	
